  `create_time` datetime DEFAULT NULL COMMENT '创建日期',
  `handle_time` datetime DEFAULT NULL COMMENT '办理时间',
  `distribution_time` datetime DEFAULT NULL COMMENT '分配时间',
  `get_time` datetime DEFAULT NULL COMMENT '接单时间',
  `finished_time` datetime DEFAULT NULL COMMENT '结束时间',
  `distribution_openid` varchar(32) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '办理人openid',
  `isok` varchar(5) DEFAULT NULL COMMENT '是否可用',
  `content` longtext COMMENT '工单内容',
  `state` varchar(5) DEFAULT NULL COMMENT '状态',
  `propertyobjectionsid` int(11) DEFAULT NULL COMMENT '物业方查验情况意见',
  `ownerobjectionid` int(11) DEFAULT NULL COMMENT '保修方验收意见',
  `successlevel` varchar(5) DEFAULT NULL COMMENT '评分等级',
  `propertyobjectionfid` int(11) DEFAULT NULL COMMENT '物业方验收意见',
  `companyobjectionfid` int(11) DEFAULT NULL COMMENT '公司验收意见',
  `descs` longtext COMMENT '备注',
  `edition` int(11) DEFAULT NULL COMMENT '版本号',
  `starttime` datetime DEFAULT NULL COMMENT '可入户开始时间',
  `endtime` datetime DEFAULT NULL COMMENT '可入户结束时间',
  `phone` varchar(11) DEFAULT NULL COMMENT '联系手机',
  `otherContact` varchar(50) DEFAULT NULL COMMENT '其他联系方式',
  `invitationid` int(11) DEFAULT NULL COMMENT '是否已有耗材',
  `reminderstate` int(1) DEFAULT NULL COMMENT '是否催单',
  `throughAudit` int(1) DEFAULT '5' COMMENT '通过审核',
  `part` varchar(40) DEFAULT NULL COMMENT '区域',
  `isPay` int(1) DEFAULT '0',
  `pctype` int(1) DEFAULT NULL COMMENT '工单类型',
  `pcserver` varchar(20) DEFAULT NULL COMMENT '服务类型',
  `publicplace` varchar(40) DEFAULT NULL,
  `roomid` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `index_name` (`distribution_openid`),
  KEY `stateindex` (`state`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

